    false,nt"url": null,nt"notes": "The National Atlas contributes to our knowledge
    of the environmental, resource, demographic, economic, social, political, and historical
    dimensions of American life. It includes products and services designed to stimulate
    children and adults to visualize and understand complex relationships between environments,
    places, and people. Unlike the previous Atlas, this version is largely in digital
    format. With a web browser and Internet connection, users are able to make their
    own personal maps. Multimedia and printed maps, as well as metadata and scientific
    articles are also available.",nt"license_title": null,nt"extras": [{ntt"key":
